  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Necedah NWR outlines
  Refuge accomplishments from January through April of 1949. The report begins by
  summarizing the weather conditions, water conditions, and food and cover during
  this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, rodents, and mammals- is also covered. The Refuge development and maintenance
  section discusses physical developments. Resource management is outlined; topics
  include fur harvesting and timber removal. The public relations section of the report
  describes Refuge visitors, Refuge participation, and violations. Items of interest,
  an annual summary, and N-R forms are attached.\",\n\t\"license_title\": \"License
